540E\u79FB1\u4E2A\uFF1B\u76F8\u5F53\u4E8Epattern\u524D\u4E24\u4F4D\uFF0C\u4E0Es\u4E2D\u7684\u591A\u4F4D\u8FDB\u884C\u5339\u914D\uFF0C\u56E0\u4E3A*\u53EF\u4EE5\u5339\u914D\u591A\u4F4D\n\n                    return self.match(s, pattern[2:]) or self.match(s[1:], pattern[2:]) or self.match(s[1:], pattern)\n            # pattern\u7B2C\u4E8C\u4E2A\u5B57\u7B26\u4E0D\u4E3A*\u7684\u60C5\u51B5\n\n            else:\n                if s[0] == pattern[0] or pattern[0] == '.':\n                    return self.match(s[1:], pattern[1:])\n                else:\n                    return False\n\n")), mdx("h2", {
